//Component EventBoard
import css from './EventBoard.module.css';
export const EventBoard = ({ events }) => {
	console.log(events);
	return (
		<div>
			<div className={css.eventBoard}>
				{events.map(event => (
					<div key={event.name}>{ event.name}</div>
				))}
			</div>
		</div>
	)


}
